import React from 'react';
import { Typography } from '@material-tailwind/react';

const Home = () => {
  return (
    <div className="relative flex h-screen content-center items-center justify-center pt-16 pb-32">
    <div className="absolute  h-full w-full bg-[url('https://th.bing.com/th/id/R.02e8506254c229be260b317461a1d6bc?rik=7Ra%2borddD8nopg&riu=http%3a%2f%2fwww.kapitalis.com%2fanbaa-tounes%2fwp-content%2fuploads%2f2019%2f11%2fMall-Of-Sousse.jpg&ehk=mnv%2b8pFeaOv%2fw6%2f63BrH8Q0DJfTOvPv5f%2fm2tJBRaHc%3d&risl=&pid=ImgRaw&r=0')] bg-cover bg-center" />
    <div className="absolute  h-full w-full bg-black/75 bg-cover bg-center" />
   
      <div className="flex flex-wrap items-center">
        
          <Typography
            variant="h1"
            
            className="mb-6 font-black"
          >
            the perfect place to own your first stand.
          </Typography>
          <Typography variant="lead"  className="opacity-80">
           Don't miss out on this exciting opportunity to grow your business and make a lasting impression!
          </Typography>
        </div>
      
 
  </div>
  
  );
};

export default Home;
